  // Vector from segment start to end
  const dx = segment.end.x - segment.start.x;
  const dy = segment.end.y - segment.start.y;

  // Vector from segment start to circle center
  const fx = segment.start.x - obstacle.center.x;
  const fy = segment.start.y - obstacle.center.y;

  // Quadratic equation coefficients for line-circle intersection
  const a = dx * dx + dy * dy;
  const b = 2 * (fx * dx + fy * dy);
  const c = (fx * fx + fy * fy) - obstacle.radius * obstacle.radius;

  const discriminant = b * b - 4 * a * c;

  // No intersection if discriminant is negative
  if (discriminant < 0) return false;

  // Check if intersection points are within the segment bounds
  const sqrt_discriminant = Math.sqrt(discriminant);
  const t1 = (-b - sqrt_discriminant) / (2 * a);
  const t2 = (-b + sqrt_discriminant) / (2 * a);

  // Collision occurs if any intersection point is within [0, 1]
